import{_ as r,a as l,b as t,c as i,d as o,e as s,f as h}from"./chunks/gazebo.zfpTF3Nz.js";import{_ as n,c as p,o as c,ab as a,m as e}from"./chunks/framework.CUflZczI.js";const q=JSON.parse('{"title":"Омнікоптер","description":"","frontmatter":{},"headers":[],"relativePath":"uk/frames_multicopter/omnicopter.md","filePath":"uk/frames_multicopter/omnicopter.md"}'),m={name:"uk/frames_multicopter/omnicopter.md"},d=a('<h1 id="омнікоптер" tabindex="-1">Омнікоптер <a class="header-anchor" href="#омнікоптер" aria-label="Permalink to &quot;Омнікоптер&quot;">​</a></h1><p>Омнікоптер - це мультикоптер, який може забезпечити тягу в усіх напрямках (6 ступенів свободи). Це дозволяє йому рухатися в будь-якому напрямку без нахилу, і він може зависати під довільним кутом нахилу. Все це досягається шляхом розташування позицій двигуна і вісі тяги у певних способах:</p><p><img src="'+r+'" alt="Омнікоптер"></p><p>Ця конструкція слідує оригінальному дизайну від <a href="https://www.youtube.com/watch?v=sIi80LMLJSY" target="_blank" rel="noreferrer">Бресчіаніні, Даріо та Рафаелло Д&#39;Андреа</a>.</p><h2 id="специфікація-матеріалів" tabindex="-1">Специфікація матеріалів <a class="header-anchor" href="#специфікація-матеріалів" aria-label="Permalink to &quot;Специфікація матеріалів&quot;">​</a></h2><p>Компоненти, необхідні для цієї збірки, є:</p><ul><li>Електроніка: <ul><li>Контролер польоту: <a href="./../flight_controller/kakuteh7.html">Holybro KakuteH7</a></li><li>Пара з 2x <a href="https://holybro.com/products/tekko32-f4-4in1-50a-esc" target="_blank" rel="noreferrer">Tekko32 F4 4in1 ESCs</a> :::info Ви можете вибрати свій власний контролер польоту за власним вибором, він просто повинен підтримувати 8 виходів DShot. :::</li><li>GPS: <a href="https://www.gnss.store/gnss-gps-modules/105-ublox-zed-f9p-rtk-gnss-receiver-board-with-sma-base-or-rover.html?search_query=ZED-F9P&amp;results=11" target="_blank" rel="noreferrer">ZED-F9P</a></li><li><a href="https://www.gnss.store/rf-gps-antennas/28-high-performance-multi-band-gnss-active-quad-helix-antenna-for-rtk.html" target="_blank" rel="noreferrer">GPS спіральна антена</a> ::: info Будь-який інший GPS також може працювати, однак очікується, що спіральна антена буде працювати краще для перевернутих польотів. :::</li><li>Будь-який RC приймач</li><li>Зовнішній магнітометр. Ми використовували <a href="https://store-drotek.com/893-professional-grade-magnetometer-rm3100.html" target="_blank" rel="noreferrer">RM-3100</a>.</li><li>Телеметричний зв&#39;язок, наприклад, <a href="./../telemetry/telemetry_wifi.html">WiFi</a></li></ul></li><li>Пропульсія: <ul><li>Двигуни: 8x <a href="https://www.getfpv.com/brotherhobby-lpd-2306-5-2000kv-2450kv-2650kv-motor.html" target="_blank" rel="noreferrer">BrotherHobby LPD 2306.5 2000KV/2450KV/2650KV</a></li><li>3D Гвинти: 2x <a href="https://www.getfpv.com/hqprop-3d-5x3-5x3-3-blade-propeller-set-of-4.html" target="_blank" rel="noreferrer">HQProp 3D 5X3.5X3 3-х лопастний гвинт (набір з 4)</a> або 2x <a href="https://www.getfpv.com/gemfan-513d-durable-3-blade-propeller-set-of-4.html" target="_blank" rel="noreferrer">Gemfan 513D 3-х лопастний 3D гвинт (набір з 4)</a></li><li>Акумулятор: ми використовували LiPo на 6S 3300mAh. Обов&#39;язково перевірте розміри, щоб він підійшов до рами.</li><li>Ремінь для акумулятора</li></ul></li><li>Рама: <ul><li>Карбонова квадратна труба R 8мм X 7мм X 1000мм, наприклад, <a href="https://shop.swiss-composite.ch/pi/Halbfabrikate/Rohre/Vierkant-Rohre/CFK-Vierkantrohr-8x8-7x7mm.html" target="_blank" rel="noreferrer">тут</a></li><li>Вуглецеві стержні R 3мм X 2мм X 1000мм, наприклад, <a href="https://shop.swiss-composite.ch/pi/Halbfabrikate/Rohre/CFK-Rohre-pultrudiert-pullwinding/Carbon-Microtubes-100cm-x-20-3mm.html" target="_blank" rel="noreferrer">тут</a></li><li>Необхідні довжини: <ul><li>квадратна трубка: 8 штук довжиною 248 мм</li><li>стрижні: 12x328мм, 6x465мм</li></ul></li><li>Гвинти: <ul><li>Двигуни та стійки: 40x M3x12мм</li><li>FC кріплення: 4x M3x35mm, 4x M3 гайки</li></ul></li><li>Опори: 4x 40мм</li></ul></li><li><a href="https://cad.onshape.com/documents/eaff30985f1298dc6ce8ce13/w/2f662e604240c4082682e5e3/e/ad2b2245b73393cf369132f7" target="_blank" rel="noreferrer">3D модель</a></li></ul><p><img src="'+l+'" alt="Parts List"></p><h2 id="збірка" tabindex="-1">Збірка <a class="header-anchor" href="#збірка" aria-label="Permalink to &quot;Збірка&quot;">​</a></h2><h3 id="рамка" tabindex="-1">Рамка <a class="header-anchor" href="#рамка" aria-label="Permalink to &quot;Рамка&quot;">​</a></h3><ul><li><p>Друкуйте деталі 3D :::info Орієнтація кутових частин має значення. Ви помітите, якщо це неправильно, коли кути важеля не вірні. :::</p></li><li><p>Відріжте важелі</p></li><li><p>Перевірте, що все працює, з&#39;єднуючи частини рамки разом:</p><p><img src="'+t+'" alt="Frame"></p></li><li><p>Розмістіть двигуни якомога далі від центру, без торкання гвинтів до важелів.</p></li></ul><h3 id="електроніка" tabindex="-1">Електроніка <a class="header-anchor" href="#електроніка" aria-label="Permalink to &quot;Електроніка&quot;">​</a></h3><p>Пропаяйте периферійні пристрої до керуючого контролера. Ми використовували наступні завдання:</p><ul><li>Регулятори швидкості: 2 регулятори швидкості можуть бути підключені безпосередньо до двох роз&#39;ємів KakuteH7. Щоб уникнути конфліктів, ми видалили контакт живлення (праворуч) з одного з&#39;єднувачів.</li><li>Телеметрія до UART1</li><li>GPS до UART4</li><li>RC до UART6 <img src="'+i+'" alt="FC closeup"></li></ul><p>Зауваження:</p><ul><li>Переконайтеся, що магнітометр розташований подалі від джерел живлення. Ми закінчили тим, що розмістили його внизу центрального елементу з пінопластом товщиною 4 см.</li><li>Покладіть деяку стрічку на барометр (не заклеюючи отвору!) для уникнення будь-якого впливу світла.</li><li>Ми не склеїли рамку. Це безумовно рекомендується зробити після початкових випробувань, але воно може працювати без цього.</li></ul><h2 id="конфігурація-програмного-забезпечення" tabindex="-1">Конфігурація програмного забезпечення <a class="header-anchor" href="#конфігурація-програмного-забезпечення" aria-label="Permalink to &quot;Конфігурація програмного забезпечення&quot;">​</a></h2><h3 id="esc" tabindex="-1">ESC <a class="header-anchor" href="#esc" aria-label="Permalink to &quot;ESC&quot;">​</a></h3><p>Спочатку налаштуйте ESC на режим 3D (бідирекційний). Ми мали проблеми з налаштуваннями запасних ESC в режимі 3D: коли спробували змінити напрямок, мотор іноді більше не запускався, поки ESC не був перезавантажений. Так що нам довелося змінити налаштування ESC.</p><p>Для цього ви можете використовувати Betaflight на контролері польоту, а потім використовувати режим пропуску і набір BL Heli (переконайтеся, що в Betaflight налаштовано повітряну раму з 8 моторами). Це налаштування:</p><p><img src="'+o+'" alt="ESC settings"></p><p>Зокрема:</p><ul><li>встановіть напрямок руху двигуна на <strong>Обидва напрямки</strong></li><li>збільшити потужність розгону до <strong>100%</strong> (це консервативно і може знизити ефективність)</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Переконайтеся, що двигуни не перегріваються зі зміненими налаштуваннями.</p></div><h3 id="px4" tabindex="-1">PX4 <a class="header-anchor" href="#px4" aria-label="Permalink to &quot;PX4&quot;">​</a></h3><ul><li>Виберіть загальний корпус багатокоптерного повітряного каркасу</li><li>Використовуйте перемикач увімкнення <a href="./../advanced_config/prearm_arm_disarm.html#arming-button-switch">зброювання</a>, не використовуйте увімкнення палицею</li><li><a href="./../config/actuators.html">Виберіть DShot</a> як протокол виводу на всіх восьми виходах</li><li>Налаштуйте двигуни відповідно до цього: <img src="'+s+'" alt="Motor Config"> Ми використовували наступну конвенцію: двигуни спрямовані в напрямку, куди вказує вісь. Напрям обертання відповідає напряму позитивного тяги (переміщення слайдера двигуна вгору). Переконайтеся, що використовуєте правильні пропси, оскільки є версія CCW та CW.</li><li>Параметри: <ul><li>Змініть логіку десатурації для кращого відстеження настрою: встановіть <a href="./../advanced_config/parameter_reference.html#CA_METHOD">CA_METHOD</a> на 0.</li><li>Вимкнути виявлення відмов: встановити <a href="./../advanced_config/parameter_reference.html#FD_FAIL_P">FD_FAIL_P</a> та <a href="./../advanced_config/parameter_reference.html#FD_FAIL_R">FD_FAIL_R</a> на 0.</li></ul></li><li><a href="https://github.com/PX4/PX4-user_guide/raw/v1.15/assets/airframes/multicopter/omnicopter/omnicopter.params" target="_blank" rel="noreferrer">Цей файл</a> містить всі відповідні параметри.</li></ul><h2 id="відео" tabindex="-1">Відео <a class="header-anchor" href="#відео" aria-label="Permalink to &quot;Відео&quot;">​</a></h2>',27),f=e("p",null,[e("div",{class:"embed-responsive embed-responsive-16by9"},[e("iframe",{class:"embed-responsive-item youtube-player",type:"text/html",width:"640",height:"390",src:"https://www.youtube.com/embed/nsPkQYugfzs",frameborder:"0",webkitallowfullscreen:"",mozallowfullscreen:"",allowfullscreen:""})])],-1),u=a('<h2 id="моделювання" tabindex="-1">Моделювання <a class="header-anchor" href="#моделювання" aria-label="Permalink to &quot;Моделювання&quot;">​</a></h2><p>Є мішень імітації омнікоптера в Gazebo Classic:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">make</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> px4_sitl</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> gazebo-classic_omnicopter</span></span></code></pre></div><p><img src="'+h+'" alt="Gazebo Sim"></p><h2 id="зауваження" tabindex="-1">Зауваження <a class="header-anchor" href="#зауваження" aria-label="Permalink to &quot;Зауваження&quot;">​</a></h2><p>Деякі загальні зауваження:</p><ul><li>Швидкість реакції газу становить близько 30%.</li><li>Час польоту становить близько 4-5 хвилин. Можливо, це можна трохи покращити, використовуючи більші пропелери.</li></ul>',7),_=[d,f,u];function b(g,k,x,w,P,C){return c(),p("div",null,_)}const S=n(m,[["render",b]]);export{q as __pageData,S as default};
